import Vue from "vue";
import Router from "vue-router";
import Login from "./pages/login/Login.vue";
import MyCase from "./pages/myCase/MyCase";

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: "/",
      name: "login",
      component: Login
    },{
      path: "/myCase",
      name: "myCase",
      component: MyCase
    }
  ]
});
